import React  from 'react';
import {
    
  useParams
  } from "react-router-dom";

const User = () => {
    //PARAMS
    const {id} = useParams();
    console.log(id)
    //Hook
    const [pueblo, setPueblo] = React.useState([])
    //UseEffect
    React.useEffect( () => {
        obtenerDatos()
    },[]);
    //Llamado a la api
    const obtenerDatos = async() => {
        const data = await fetch(``)
        const users = await data.json(`https://age-of-empires-2-api.herokuapp.com/api/v1/civilization/${id}`)//tenemos la info a JSON
        setPueblo(users.civilizations)
    }
    //retorno de la aplicación
    return(
        <h1>Users</h1>
    );
}
export default User
